/**
 * Set of all {@link FutureMove future} moves.
 *
 * Maps move name to its id within this object.
 */
export const futureMoves = {
    doomdesire: 0,
    futuresight: 1,
} as const;

/** Types of future moves. */
export type FutureMove = keyof typeof futureMoves;

/** Sorted array of all {@link FutureMove future} moves. */
export const futureMoveKeys: readonly FutureMove[] = [
    "doomdesire",
    "futuresight",
];

/** Checks if a value is a {@link FutureMove}. */
export function isFutureMove(value: unknown): value is FutureMove {
    return Object.hasOwnProperty.call(futureMoves, value as PropertyKey);
}

